function App() {
  return (
    <div id="wrapper">

          <header id="header">
            <div class="inner">

                <a href="index.html" class="logo">
                  <span class="symbol"><img src="content/images/common/me2021.jpg" alt="" /></span><span class="title">Sebastian S. Rodriguez</span>
                </a>

            </div>
          </header>

          <div id="main">
            <div class="inner">
              <header>
                <h1>Software Engineer and UX Researcher</h1>
              <p>I like building experiences and systems, and reseaching the interaction with a  human factors lens.</p>
                <p>Human-Computer Interaction ABD PhD @ <a href="https://cs.illinois.edu/"><strong>UIUC</strong></a><br></br>Previously UX Research Intern @ <a href="https://tech.fb.com/"><strong>Facebook</strong></a><br></br>
                Previously Research Fellow @ <a href="https://www.arl.army.mil/"><strong>Army Research Laboratory</strong></a><br></br>
                </p>
              </header>
              <section class="tiles">
                      <GridElement />
                      <GridElement />
                      <GridElement />
                      <GridElement />

              </section>
            </div>
          </div>

          <footer id="footer">
            <div class="inner">
              <section>
                <h3>srodri44 [at] illinois [dot] edu</h3>
                <ul class="icons">
                  <li><a target="_blank" href="content/docs/resume.pdf" class="icon style2 fa-file"><span class="label">Resume</span></a></li>
                  <li><a target="_blank" href="https://github.com/srodriguez1850" class="icon brands style2 fa-github"><span class="label">GitHub</span></a></li>
                  <li><a target="_blank" href="https://www.linkedin.com/in/srodriguez1850/" class="icon brands style2 fa-linkedin"><span class="label">LinkedIn</span></a></li> 
                </ul>
              </section>
              <ul class="copyright">
                <li>&copy; Sebastian S. Rodriguez. All rights reserved</li><li>Design: <a href="https://html5up.net">HTML5 UP</a></li>
                <li>Last Updated: September 2021</li>
              </ul>
            </div>
          </footer>

      </div>
    );
}

export default App;
